 function App() {
  return (
    <Router>
      <div className="App">
        <Switch>

          <Route path="/" exact component ={HomePage}/>  
          <Route path="/search" exact component ={ResultsPage}/>
          <Route path="/allpackages" exact component ={AllPackages}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
